        top = -1;   // initializing top pointer with -1 (empty stack)  
    }

    void push(string data); // function to add an element to the stack

    string pop();          // function to remove an element from the stack

    bool isEmpty();        // function to check if the stack is empty or not

    bool isFull();         // function to check if the stack is full or not

    int getSize();         // function to get the size of the stack

    string peek();         // function to return the top element of the stack without removing it.  

	~Stack() {             // destructor to delete dynamically allocated memory  								      (array) when object goes out of scope.  
        delete arr;  
    }  	    	    	    	    	    	    	    	    	    	    	    
}; 

 void Stack::push(string data) {      // adding an element in a non-full stack.  

        if (isFull()) {               // checking if the stack is full or not.  

            cout << "Stack Overflow" << endl;     

            return;                   

        } else {                      

            arr[++top] = data;         // adding data at top position and incrementing it.  

            cout << data << " pushed into Stack" << endl;     

        }          

 }      

