    public static void main(String[] args) {
        int n = 5;
        printPattern(n);
    }

    public static void printPattern(int n) {
        int i, j, k = 2 * n - 2;

        for (i = 0; i < n; i++) {
            for (j = 0; j < k; j++) {
                System.out.print(" ");
            }
            k = k - 2;
            for (j = 0; j <= i; j++) {
                System.out.print("* ");
            }
            System.out.println();
        }
        k = n - 2;
        for (i = n; i > 0; i--) {
            for (j = 0; j < k; j++) {
                System.out.print(" ");
            }
            k = k + 2;
            for (j = 0; j < i; j++) {
                System.out.print("* ");
            }
            System.out.println();
        }
    }
}

